import React, { useState } from 'react'
import PatientNavBar from '../Components/PatientNavBar'

function Complaint() {
  const [complaints,setComplaints]=useState([{
    hospitalId:1,
    complaints:"VeryBad"
  }])
  return (
    <div>
      <PatientNavBar/>
      <div>
        {
        complaints.map((co)=>{
          <h3>
            co.complaints
          </h3>
        })
        }
      </div>
    </div>
  )
}

export default Complaint
